  border-radius: 3px;
}
.nav > li > a:hover {
  background-color: rgba(140, 115, 115, 0.12);
}
.nav.nav-pills > li.active > a {
  background-color: rgba(140, 115, 115, 0.18);
}
h1,
h2,
h3,
h4,
h5,
h6 {
  font-family: inherit;
}
body {
  font-family: inherit;
  font-size: inherit;
}
